import './TeamsList.css';
function TeamsList()

{
    return(
        <div className='TeamsList'>
        <center>
            <b>
                List of Teams in IPL 2023
            </b><br></br>
            <ol>
                <li>CSK</li>
                <li>MI</li>
                <li>RCB</li>
                <li>KKR</li>
                <li>DC</li>
                <li>LSG</li>
            </ol>
        </center>
        </div>
    )
}
export default TeamsList;
